import React from "react";
import Button from "./Button";
import { Wave } from "react-animated-text";
import { Link } from "react-router-dom";

const Home = () => {
    return (
        <main className="homePage">
            <Wave text="Wanna Register as a :" />
            <h1>Home</h1>
            <span>Register as a:&emsp;</span>
            <section id="home">
                <h1 id="title">WE MADE YOUR MEDICAL TREATMENT EASY</h1>
                <p id="para">
                    Start an instant consultation within 2 minutes or do video
                    consultation at the scheduled time.
                </p>
                <img src="img\doctor.png" alt="dotorbg" id="img1" />
                <div class="option">
                    <button class="btn1">doctors</button>
                    <button class="btn1">volunteers</button>
                    <button class="btn1">patients</button>
                </div>
            </section>
            <Link to={"/organization"}>
                <Button buttonText={"Organization"} />
            </Link>
            &emsp;
            <Link to={"/patient"}>
                <Button buttonText={"Patient"} />
            </Link>
            &emsp;
            <Link to={"/doctor"}>
                <Button buttonText={"Doctor"} />
            </Link>
        </main>
    );
};

export default Home;
